
<!DOCTYPE html>
<html lang="ko">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>블록체인 레포트 2</title>
    <style>
        body {
            margin: 0;
            padding: 0;
            font-family: Arial, sans-serif;
            background-color: beige;
        }

        .navbar {
            display: flex;
            justify-content: center;
            margin-top: 10px;
            margin-left: 5px;
            margin-right: 5px;
            background-color: gray;
            border: 5px solid black;
            border-radius: 20px;
        }

        .navbar button {
            position: relative;
            margin: 10px;
            margin-left: 15px;
            margin-right: 15px;
            width: 100px; /* 버튼 너비 */
            height: 100px; /* 버튼 높이 */
            background: white; /* 정면 색상 */
            border: 2px solid black; /* 테두리 */
            border-radius: 5px; /* 모서리 살짝 둥글게 */
            box-shadow: 5px 5px 10px rgba(0, 0, 0, 0.2); /* 그림자 효과 */
            color: black; /* 텍스트 색상 */
            font-weight: bold; /* 텍스트 굵기 */
            text-align: center; 
            line-height: 100px; /* 버튼 높이와 같은 값으로 텍스트 수직 정렬 */
            cursor: pointer; /* 클릭 가능 표시 */
            transition: transform 0.2s ease, box-shadow 0.2s ease; /* 클릭 효과 애니메이션 */
        }

        .navbar button:hover {
            transform: translateY(-5px); /* 살짝 위로 떠오름 */
            box-shadow: 8px 8px 15px rgba(0, 0, 0, 0.3); /* 그림자 확대 */
        }

        /* 클릭 시 눌리는 효과 */
        .navbar button:active {
            transform: translateY(2px); /* 눌린 느낌 */
            box-shadow: 3px 3px 6px rgba(0, 0, 0, 0.2); /* 그림자 줄임 */
        }

        .navbar button:hover {
            background-color: #283593;
            color: #ffffff;
        }

        .content {
            padding: 10px;
            text-align: center;
            display: none;
            /* border: 5px solid black;
            border-radius: 20px; */
        }

        .content img{
            width: 100%;
            height: 90%;
            border: 5px solid black;
            border-radius: 20px; 
        }
        .content.active {
            display: block;
        }
        
        .footer{

            display: flex; /* Flexbox 활성화 */
            justify-content: space-between; /* 아이템 간 최대 간격 */

            background-color: gray;
            border-radius: 20px;
            border: 5px solid black;
            font-weight: bold;
            margin-left: 5px;
            margin-right:5px ;
            font-size: 20px;
        }

        .footer .left{
            padding-left: 20px;
            margin: 5px;
        }
        .footer .left a{
            padding: 3px;
            border: 2px solid black;
            border-radius: 5px;
            background-color: darkgrey;
            color: black;
        }
        .footer .left a:hover {
            background-color: #283593;
            color: #ffffff;
        }
        .footer .right{
            margin-top: 5px;
            padding-right: 10px;
        }
    </style>
</head>

        <button onclick="showPage(1)">블록 1</button>
